examples:
**Install**
```js
import Vue from 'vue'
// import module and styles
import { Map } from 'vuelayers'
// or
import Map from 'vuelayers/lib/map'
// import VueLayers styles
import 'vuelayers/lib/style.css'
// register vl-map and vl-view components
Vue.use(Map)
```

